import "./App.css";
import React, { useEffect, useState } from "react";
import NewItemContainer from "./component/NewItemContainer";
import PocketItemContainer from "./component/PocketItemContainer";

function App() {
  const [historys, setHistorys] = useState(null);

  const getHistorys = () => {
    fetch("http://localhost:3001/historys")
      .then((res) => res.json())
      .then((data) => {
        setHistorys(data);
      })
      .catch((e) => {
        console.log(`에러 캐치 ${e}`);
      });
  };
  useEffect(() => {
    setTimeout(() => {
      getHistorys();
    }, 1000);
  }, []);

  return (
    <div className="App">
      <h1>my consumtion record</h1>
      <NewItemContainer />
      {historys && <PocketItemContainer historys={historys} />}
    </div>
  );
}

export default App;
